People = new Mongo.Collection("people", {});

Data = {};
Data.Viewed = {};
Data.Viewed.User = new Mongo.Collection("dataViewedUser", {});

Data.Viewed.User.Schema = new SimpleSchema({
	vocabularyId: {
		type: String
	},
	userId: {
		type: String,
		autoValue: function() {
			return this.userId;
		}
	},
	vocabularyName: {
		type: String
	},
	timesViewed: {
		type: Number
	},
	createdAt: {
		type: Date,
		autoValue: function() {
			return new Date();
		}
	}
});

Data.Viewed.User.attachSchema(Data.Viewed.User.Schema);
